import {Nav} from "react-bootstrap";

export default function Sidebar(){
    return (
        <div className="border-end bg-white h-100  position-fixed" id="sidebar-wrapper">

            <Nav className="list-group list-group-flush  h-100">
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-4" href="1" ><i className="fas fa-bell"></i>Explore
                    <i className="bi-alarm" style="font-size: 2rem; color: cornflowerblue;"></i>
                </Nav.Link>
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-4" href="1">News</Nav.Link>
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-4" href="2">Profile</Nav.Link>
                <Nav.Link className="list-group-item list-group-item-action list-group-item-light p-4" href="3">Friend</Nav.Link>

            </Nav>
        </div>
    );
};
